import React from 'react'

const Filmdetails = () => {

    axios({
        method: 'get',
        url: "https://api.themoviedb.org/3/movie/550?api_key=85cd5e63356ff0dc25f30b35f77d2140"
    })

    return (
    <div className="film-details">
        <h1 className="section-title">DETAILS</h1>
    </div>
    )
}

export default Filmdetails
